const Item = function ({ name, description, score }) {
  return (
    <Link>
      <li>
        <BiCameraMovie />
        <strong>{name}</strong>
        <small>- {description}</small>
        <em>score: {score}</em>
      </li>
    </Link>
  );
};

export default Item;
